# k is 1-based

def gen(ain, aout):
    p = [ 0 , 1, 0, -1 ] 
    n = len(ain)
   
    for k in range(1, n + 1):
        s = 0
        for i in range(n):
            m = p[((i + 1) // k) % 4]
            if D: print("{}*{}".format(ain[i],m), end=' ')
            s += ain[i] * m
        if D: print()
        aout[k - 1] = abs(s) % 10

    if D: print(aout)
    

